import React, {useState} from 'react';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
   
const App = () => {
  return (
    <React.Fragment>
      <h1 className='text-capitalize text-center mt-5 text-danger'> Welcome to my channel </h1>
      <button className='btn btn-success'> Thakur </button>
    </React.Fragment>
  );
};

export default App;
